//    <h1>Hello World!</h1> ,
//    document.getElementById('root')

// )

ReactDOM.render( React.createElement(

   "h1",
   null,
   "Hello World!"),

   document.getElementById('root')

)

let h1 = document.createElement('h1');
h1.innerHTML="Hey";
document.getElementById('root').appendChild(h1)
